window.bookSummaryJSON = "<p><b><i>He claimed her, not for love, but for vengeance.<br> Yet his enemies had other plans.</i></b><br> <br> After Tavish, the ruthless Unseelie King, stole Lira and brought her to his kingdom, he fully intended to drain her royal Seelie blood to free his people and reclaim his rightful lands.<br> <br> When Lira teetered on the edge of death, something inside him snapped and altered his plans.<br> <br> Once he succumbed to their fated mate bond, her death was no longer an option, and he stopped fighting the inevitable pull, knowing this very decision could incite his people to rebel against him.<br> <br> Though he’s determined to find another way to free his people while keeping Lira at his side, the Seelie attack, taking Lira from him.<br> <br> She’s returned to Seelie land where her parents intend to hand her over to the dragon prince—the man they betrothed her to years ago.<br> <br> Everything stacks against them being together, but Tavish refuses to accept defeat.<br> <br> Lira is his… and no one else's. And he’ll kill anyone who gets in his way.<br> <br> <b><i>The Court of Thorns and Wings is a slow-burn, royal fae romantasy that includes betrayal, morally gray characters, enemies-to-lovers, villain gets the girl, political intrigue, who did this to you, and touch her and unalive. One-click this story today.</i></b></p>"; 
